import { useLocation } from "react-router-dom";

function Cart() {
    const location = useLocation();
    const productId = new URLSearchParams(location.search).get("productId");

    return (
        <div>
            <h1>Cart</h1>
            <p>Product id: {productId}</p>
        </div>
    );
}
export default Cart;
